import random

from playwright.sync_api import sync_playwright
import base64
import ddddocr

with sync_playwright() as p:
    browser = p.chromium.launch(
        headless=False,
        slow_mo=2000,
        args=['--start-maximized']
    )
    context = browser.new_context(no_viewport=True)
    page = context.new_page()
    page.goto('https://www.geetest.com/demo/slide-float.html')

    # 定位点击按钮
    page.locator('.geetest_radar_tip').click()
    page.wait_for_timeout(3000)

    # 获取canvas元素背景图
    bg_src = page.evaluate(
        "document.getElementsByClassName('geetest_canvas_bg geetest_absolute')[0].toDataURL('image/png')")
    # 获取canvas完整图
    piece_src = page.evaluate(
        "document.getElementsByClassName('geetest_canvas_fullbg geetest_fade geetest_absolute')[0].toDataURL('image/png')")
    print(type(bg_src))
    print(f'bg为：{bg_src}')
    print(f'full为：{piece_src}')


    """
    <class 'str'>
    bg为：data:image/png;base64,
    full为：data:image/png;base64,
    """

    # 图片编码数据为最后一节数据，将得到的字符串类型切割，只取最后一节
    # 先将数据转化为字符串类型
    bg_base = str(bg_src).split(',')[-1]
    # 用base64解码
    new_bg_base = base64.b64decode(bg_base)
    # 将解码的数据写入指定的新建图片中
    with open('./bg.png', 'wb') as f1:
        f1.write(new_bg_base)


    piece_base = str(piece_src).split(',')[-1]
    new_piece_base = base64.b64decode(piece_base)
    # 将解码的数据写入指定的新建图片中
    with open('./piece.png', 'wb') as f2:
        f2.write(new_piece_base)


    # 进行缺口识别
    def compare_img():
        # 新建一个图像识别的对象
        slide = ddddocr.DdddOcr(show_ad=False, det=False, ocr=False)
        # 读取背景图片数据信息
        with open('./bg.png', 'rb') as fp1:
            bg_info = fp1.read()

        # 读取缺省图片数据信息
        with open('./piece.png', 'rb') as fp2:
            piece_info = fp2.read()


        res = slide.slide_comparison(piece_info, bg_info)
        print(res)
        # 返回距离的缺口值
        return res.get('target')[0]
    dis = compare_img()
    print(dis) # 2


    # 定位到滑动按钮元素并选中,返回按钮x、y轴信息
    btn = page.locator('.geetest_slider_button').bounding_box()
    print(btn) # 'x': 344.21875, 'y': 345.328125, 'width': 65.96875, 'height': 65.96875}

    # 拖动鼠标位置去调试匹配缺口
    # 按钮初始位置
    page.mouse.move(x=btn['x'], y=btn['y']+btn['height']/2)
    # 居中按下按钮
    page.mouse.down(button='middle')
    # 等待3s
    page.wait_for_timeout(300)
    # 开始移动(因为需要过电脑识别，所以需要速度慢一点多试几次)
    page.mouse.move(x=btn['x']+dis+random.randint(2,8), y=btn['y']+btn['height']/2)
    page.wait_for_timeout(300)
    page.mouse.move(x=btn['x']+dis-2, y=btn['y']+btn['height']/2)
    page.wait_for_timeout(400)
    page.mouse.move(x=btn['x']+dis-4.5, y=btn['y']+btn['height']/2)
    page.wait_for_timeout(300)
    page.mouse.move(x=btn['x']+dis-7, y=btn['y']+btn['height']/2)

    # 松开鼠标
    page.mouse.up(button='middle')


    context.close()